import React from 'react'
import './style.css'
import ReactDOM from 'react-dom';
function Welcome(props) {
    return <h1>Hello, {props.name}</h1>;
  }

  const element = <Welcome name="Sara" />;
  ReactDOM.render(
    element,
    document.getElementById('root')
  );
export default test;
